import axios from "axios";
import React, { useEffect, useState } from "react";
import starwars from "../../image/starwars.png";
import "./Exercise2.scss";

const Exercise2 = () => {
  const [data, setData] = useState([]);
  const [speed, setSpeed] = useState(0);
  const [cost, setCost] = useState("");
  const [passengers, setPassengers] = useState(0);
  const [film, setFilm] = useState(0);

  useEffect(() => {
    try {
      (async function () {
        let res = await axios.get("https://swapi.dev/api/starships/?page=1");
        let data = res && res.data ? res.data : [];
        setData(data);

        console.log("data:", data.results);
      })();
    } catch (error) {
      console.log(error);
    }
  }, []);
  console.log("data: ", data);
  return (
    <div className="container">
      {/* <h1>Hello cac ban</h1> */}
      <div className="header-scores">
        <span>0</span>
        <span>1</span>
      </div>
      <div className="body">
        <div className="body-item">
          <div className="body-title">Snowspeeder</div>
          <div className="body-image">
            <img src={starwars} alt="" />
          </div>
          <div className="body-list">
            <div className="item">
              <span>Max Speed</span>
              <span>650</span>
            </div>
            <div className="item">
              {" "}
              <span>Credit</span>
              <span>unknown</span>
            </div>
            <div className="item">
              {" "}
              <span>Passengers</span>
              <span>0</span>
            </div>
            <div className="item">
              {" "}
              <span>Film Appearances</span>
              <span>1</span>
            </div>
          </div>
        </div>
        <div className="body-item">
          <div className="body-title">Storm TV Twin-Pod cloud car</div>
          <div className="body-image">
            <img src={starwars} alt="" />
          </div>
          <div className="body-list">
            <div className="item">
              <span>Max Speed</span>
              <span>?</span>
            </div>
            <div className="item">
              {" "}
              <span>Credit</span>
              <span>?</span>
            </div>
            <div className="item">
              {" "}
              <span>Passengers</span>
              <span>?</span>
            </div>
            <div className="item">
              {" "}
              <span>Film Appearances</span>
              <span>?</span>
            </div>
          </div>
        </div>
      </div>
      <div className="footter">
        <button>Play Random</button>
      </div>
    </div>
  );
};

export default Exercise2;
